import {Box,Heading,Text,HStack} from '@chakra-ui/react';


function MealDeals(){
    return(
        <Box>
            <Box bgColor='#f0f0f0'>
                <Box paddingLeft='20px' paddingRight="30px">
                    <HStack>
                        <Text>Meat-Free Deals</Text> | <Text>Restaurants In N</Text>
                    </HStack>
                </Box>
            </Box>
        </Box>
    )
}

export default MealDeals;
